import { useState, useEffect } from "react";
import { useNavigate, useLocation, Link } from "react-router-dom";
import { useAuth } from "../context/AuthContext";
import logo from "../images/logo.svg";

export default function ResultPage() {
  const navigate = useNavigate();
  const location = useLocation();
  const { user } = useAuth();
  const [isProfileMenuOpen, setIsProfileMenuOpen] = useState(false);
  const [results, setResults] = useState([]);
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState("");

  // Ê∑ªÂä†ÁÇπÂáªÂ§ñÈÉ®ÂÖ≥Èó≠ËèúÂçïÁöÑÂ§ÑÁêÜÂáΩÊï∞
  useEffect(() => {
    const closeMenu = (e) => {
      if (isProfileMenuOpen && !e.target.closest(".profile-menu-container")) {
        setIsProfileMenuOpen(false);
      }
    };

    document.addEventListener("click", closeMenu);
    return () => document.removeEventListener("click", closeMenu);
  }, [isProfileMenuOpen]);

  useEffect(() => {
    // Â¶ÇÊûú‰ªé location ‰º†ÈÄí‰∫ÜÈîôËØØ‰ø°ÊÅØÔºåÊòæÁ§∫ÈîôËØØ
    if (location.state?.error) {
      setError(location.state.error);
    }

    // Â¶ÇÊûú‰ªé location ‰º†ÈÄí‰∫ÜÂåπÈÖçÁªìÊûúÔºå‰ΩøÁî®ÂÆÉ‰ª¨
    if (
      location.state?.matchingResults &&
      location.state.matchingResults.length > 0
    ) {
      setResults(location.state.matchingResults);
    } else {
      // Âê¶Âàô‰ªé API Ëé∑ÂèñÂåπÈÖçÁªìÊûú
      fetchMatchingResults();
    }
  }, [location]);

  const fetchMatchingResults = async () => {
    setIsLoading(true);
    setError("");

    try {
      const token = localStorage.getItem("token");
      if (!token) {
        throw new Error("Êú™ÁôªÂΩïÔºåËØ∑ÂÖàÁôªÂΩï");
      }

      // Ëé∑ÂèñÁî®Êà∑ ID
      const userId = user?._id || user?.id;
      if (!userId) {
        throw new Error("Êó†Ê≥ïËé∑ÂèñÁî®Êà∑ ID");
      }

      // ‰ªé Python ÂåπÈÖçÊúçÂä°Ëé∑ÂèñÂåπÈÖçÁªìÊûú
      const response = await fetch(
        `http://localhost:5000/api/match_partners?user_id=${userId}`,
        {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        }
      );

      const data = await response.json();
      if (!response.ok) {
        throw new Error(data.message || "Ëé∑ÂèñÂåπÈÖçÁªìÊûúÂ§±Ë¥•");
      }

      setResults(data.results || []);
    } catch (error) {
      console.error("Ëé∑ÂèñÂåπÈÖçÁªìÊûúÈîôËØØ:", error);
      setError(error.message || "Ëé∑ÂèñÂåπÈÖçÁªìÊûúÊó∂Âá∫Èîô");
    } finally {
      setIsLoading(false);
    }
  };

  const getColorByCategory = (category) => {
    const colorMap = {
      "üåü ÊûÅ‰Ω≥ÂåπÈÖç": "#4CAF50",
      "‚úÖ ËâØÂ•ΩÂåπÈÖç": "#2196F3",
      "üü° ‰∏ÄËà¨ÂåπÈÖç": "#FFC107",
      "üî¥ ‰ΩéÂåπÈÖç": "#FF5722",
      "‚ö´Ô∏è ‰∏çÂåπÈÖç": "#9E9E9E",
    };
    return colorMap[category] || "#9E9E9E";
  };

  return (
    <div className="min-h-screen bg-gray-50">
      {/* È°∂ÈÉ®ÂØºËà™Ê†è */}
      <div
        className="App-header"
        style={{ height: "auto", minHeight: "auto", padding: "0" }}
      >
        <nav>
          <div className="logo">
            <img src={logo} alt="logo" />
            <span>Cause-connect</span>
          </div>
          <div className="nav-links">
            <a href="#">Explore</a>
            <Link to="/partnership-search">Partnership</Link>
            <a href="#">Solutions</a>
            <div className="profile-menu-container relative">
              <div
                className="flex items-center gap-1 ml-4 cursor-pointer"
                onClick={() => setIsProfileMenuOpen(!isProfileMenuOpen)}
              >
                <div className="w-8 h-8 rounded-full bg-gray-100 flex items-center justify-center">
                  <svg
                    className="w-5 h-5 text-gray-600"
                    fill="none"
                    stroke="currentColor"
                    viewBox="0 0 24 24"
                  >
                    <path
                      strokeLinecap="round"
                      strokeLinejoin="round"
                      strokeWidth="2"
                      d="M16 7a4 4 0 11-8 0 4 4 0 018 0zM12 14a7 7 0 00-7 7h14a7 7 0 00-7-7z"
                    />
                  </svg>
                </div>
                <span className="text-sm text-gray-700 font-medium">
                  {user?.orgName || user?.name}
                </span>
                <svg
                  className={`w-4 h-4 text-gray-500 transition-transform duration-200 ${
                    isProfileMenuOpen ? "transform rotate-180" : ""
                  }`}
                  fill="none"
                  stroke="currentColor"
                  viewBox="0 0 24 24"
                >
                  <path
                    strokeLinecap="round"
                    strokeLinejoin="round"
                    strokeWidth="2"
                    d="M19 9l-7 7-7-7"
                  />
                </svg>
              </div>

              {/* ‰∏ãÊãâËèúÂçï */}
              {isProfileMenuOpen && (
                <div className="absolute right-0 top-full mt-1 w-48 rounded-md shadow-lg bg-white ring-1 ring-black ring-opacity-5 z-50">
                  <div className="py-1">
                    <a
                      href="#"
                      className="block px-4 py-2 text-sm text-gray-700 hover:bg-gray-100"
                    >
                      Profile Settings
                    </a>
                    <button
                      onClick={() => {
                        localStorage.removeItem("token");
                        window.location.href = "/";
                      }}
                      className="block w-full text-left px-4 py-2 text-sm text-gray-700 hover:bg-gray-100"
                    >
                      Sign Out
                    </button>
                  </div>
                </div>
              )}
            </div>
          </div>
        </nav>
      </div>

      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
        <div className="mb-6">
          <h1 className="text-2xl font-semibold text-gray-900">
            Partnerships for you
          </h1>
          {location.state?.searchParams && (
            <div className="mt-2 text-sm text-gray-500">
              <span>Search criteria: </span>
              {location.state.searchParams.location && (
                <span className="mr-2">
                  Location: {location.state.searchParams.location}
                </span>
              )}
              {location.state.searchParams.organizationType && (
                <span className="mr-2">
                  Organization Type:{" "}
                  {location.state.searchParams.organizationType}
                </span>
              )}
            </div>
          )}
        </div>

        {/* ÈîôËØØÊèêÁ§∫ */}
        {error && (
          <div className="mb-4 p-3 bg-red-100 text-red-700 rounded-lg">
            {error}
          </div>
        )}

        {/* Âä†ËΩΩÁä∂ÊÄÅ */}
        {isLoading ? (
          <div className="flex justify-center items-center h-64">
            <svg
              className="animate-spin h-10 w-10 text-teal-500"
              xmlns="http://www.w3.org/2000/svg"
              fill="none"
              viewBox="0 0 24 24"
            >
              <circle
                className="opacity-25"
                cx="12"
                cy="12"
                r="10"
                stroke="currentColor"
                strokeWidth="4"
              ></circle>
              <path
                className="opacity-75"
                fill="currentColor"
                d="M4 12a8 8 0 018-8V0C5.373 0 0 5.373 0 12h4zm2 5.291A7.962 7.962 0 014 12H0c0 3.042 1.135 5.824 3 7.938l3-2.647z"
              ></path>
            </svg>
          </div>
        ) : (
          <>
            {/* ÁªìÊûúÂàóË°® */}
            {results.length === 0 ? (
              <div className="text-center py-10">
                <p className="text-gray-500">
                  No matching partners found. Try adjusting your search
                  criteria.
                </p>
              </div>
            ) : (
              <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
                {results.map((result) => (
                  <div
                    key={result.id}
                    className="bg-white p-6 rounded-xl shadow-sm hover:shadow-md transition-shadow"
                  >
                    <h3 className="text-xl font-semibold text-gray-900">
                      {result.name}
                    </h3>
                    <p className="text-gray-500 mb-3">{result.location}</p>

                    <div
                      className="px-3 py-2 rounded-lg mb-3 text-white inline-block"
                      style={{
                        backgroundColor: getColorByCategory(
                          result.matchCategory
                        ),
                      }}
                    >
                      {result.matchCategory}
                    </div>

                    {result.mission_statement && (
                      <p className="mt-2 text-sm text-gray-600 mb-3">
                        {result.mission_statement}
                      </p>
                    )}

                    {result.core_values && result.core_values.length > 0 && (
                      <div className="flex flex-wrap gap-2 mb-3">
                        {result.core_values.map((value, index) => (
                          <span
                            key={index}
                            className="px-2 py-1 bg-blue-50 text-blue-600 text-sm rounded"
                          >
                            {value}
                          </span>
                        ))}
                      </div>
                    )}

                    {result.website && (
                      <a
                        href={result.website}
                        target="_blank"
                        rel="noopener noreferrer"
                        className="mt-2 inline-block text-teal-500 hover:text-teal-700"
                      >
                        Visit Website
                      </a>
                    )}
                  </div>
                ))}
              </div>
            )}
          </>
        )}
      </div>
    </div>
  );
}
